import {
  Stack,
  Button
} from "@mui/material";
const Navbar = ()=>{
  const design = (
    <>
          <Stack direction="row" justifyContent="space-evenly">
          <Button variant="contained">Button-1</Button>
          <Button variant="contained">Button-2</Button>
          <Button variant="contained">Button-3</Button>
          </Stack>
    </>
  );
  return design;
}
export default Navbar;
